class LogoutDialogComponent {
    constructor(router, ref) {
        this.router = router;
        this.ref = ref;
    }
    ngOnInit() {
        this.loggingout = false;
    }
    logout() {
        this.loggingout = true;
        //  delete user
        setTimeout(() => {
            localStorage.removeItem('user');
            localStorage.removeItem('token');
            this.loggingout = false;
            this.ref.close();
            this.router.navigate(['/']);
        }, 5000);
    }
}


